        return new Source("{% extends 'admin.html.twig' %}

{% block title %}Contact index{% endblock %}

{% block body %}
    <h1>Contact index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Client</th>
                <th>Email</th>
                <th>Phone</th>
                <th>Job</th>
                <th>Main</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for contact in contacts %}
            <tr>
                <td>{{ contact.id }}</td>
                <td>{{ contact.name }}</td>
                <td>{{ contact.client.name }}</td>
                <td>{{ contact.email }}</td>
                <td>{{ contact.phone }}</td>
                <td>{{ contact.job }}</td>
                <td>{{ contact.main ? 'Yes' : 'No' }}</td>
                <td>
                    <a href=\"{{ path('contact_show', {'id': contact.id}) }}\">show</a>
                    <a href=\"{{ path('contact_edit', {'id': contact.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"7\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('contact_new') }}\">Create new</a>
{% endblock %}
